/**
 * App object
 * Uppercase — constructors
 * Lowercase — methods & instances
 *
 * @type {{Collections: {}, collections: {}, Models: {}, models: {}, Views: {}, Routers: {}, init: Window.App.init}}
 */

window.App = {
	Collections: {},
	Models: {},
	Views: {},
	Routers: {},

	collections: {},
	models: {},
	views: {},
	routers: {},

	init: function () {
		App.models.upload = new App.Models.Upload();
		App.models.image = new App.Models.Image();
		App.models.app = new App.Models.App();
		
		App.collections.images = new App.Collections.Images();

		App.routers.index = new App.Routers.Index();
		Backbone.history.start();
	}
};

(function ($) {
	$(function () {
		App.init();
	});
})(jQuery);
App.Collections.Base = Backbone.Collection.extend();
App.Models.Image = Backbone.Model.extend({
	url: '/public/image.php',
	defaults: {
		id: null,
		storage: '',
		url: '',
		name: ''
	},
	destroy: function (options) {
		this.trigger('destroy', this, this.collection, options);
	}
});

App.Collections.Images = Backbone.PageableCollection.extend({
	url: '/public/images.php',
	model: App.Models.Image,
	prefetched: {},
	state: {
		firstPage: 1,
		currentPage: 1,
		pageSize: 12
	},
	queryParams: {
		currentPage: "current_page",
		pageSize: "page_size"
	},
	update: function (col, resp, opts) {
		App.collections.images.reset(resp.images, opts);
		App.models.app.set('pagination', resp.pagination);

		App.views.images.animationEnd();
	}
});
App.Models.App = Backbone.DeepModel.extend({
	url: '/public/images.php',
	defaults: {
		pagination: {
			items: 0,
			pages: 1,
			currentPage: 1,
			pagesLimit: 10,
			pageSize: 12,
			storages: {}
		}
	},
	initialize: function () {
		
	},
});
// Image model constructor is in collections/images.js
// Backbone restictions (Model must be declared before Collection, that used this model)
App.Models.Message = Backbone.Model.extend({
	defaults: {
		type: 'danger',
		close: false
	}
});
App.Models.Upload = Backbone.Model.extend({
	defaults: {
		storage: 1,
		source_type: 'file',
		url: ''
	}
});
App.Routers.Index = Backbone.Router.extend({
	routes: {
		'': 'index',
		'#': 'index',
		'page/:id': 'page',

		'*notFound': 'notFound'
	},
	initialize: function () {
		App.views.index = new App.Views.Index({
			model: App.models.app
		});
	},
	page: function (pageID) {
		App.views.images.renderPage(+pageID);
		App.models.app.set('pagination.currentPage', +pageID);
	},
	index: function () {
		App.views.images.renderPage(1);
	},
	notFound: function(){
		App.views.index.render404();
	}
});
App.Views.Image = Backbone.View.extend({
	url: '/public/image.php',
	template: _.template($('#tpl-image').html()),
	events: {
		'click [data-action="delete"]': 'handleDelete',
		'click [data-action="get-link"]': 'handleGetLink',
		'click [data-action="get-code"]': 'handleGetCode'
	},
	initialize: function () {
		this.render();
	},
	animationStart: function(){
		this.$el.find('.panel-body').addClass('anim-active');
	},
	animationEnd: function(){
		this.$el.find('.panel-body').removeClass('anim-active');
	},
	handleGetLink: function(e){
		var _this = this;
		new Clipboard('.btn', {
			text: function(trigger) {
				return _this.model.get('url');
			}
		});
	},
	handleGetCode: function(e){
		var _this = this;
		new Clipboard('.btn', {
			text: function(trigger) {
				return '<img src="' + _this.model.get('url')+ '">';
			}
		});
	},
	handleDelete: function () {
		var _this = this;
		var data = this.model.toJSON();
		data.method = 'DELETE';

		this.animationStart();
		
		$.ajax({
			url: this.url,
			type: 'POST',
			data: data,
			success: function(){
				_this.model.destroy();
				App.views.images.$el.append('<li class="anim-active">');
				App.collections.images.fetch({
					success: function (col, resp, opts) {
						App.collections.images.reset(resp.images, opts);
						App.models.app.set('pagination', resp.pagination);
					}
				});
			}
		});
	},
	render: function () {
		this.$el.html(this.template(this.model.toJSON()));
	},
});
App.Views.Images = function () {
	this.$el = $('#images_list');

	this.infoView = new App.Views.Info({
		el: $('#images_info'),
		model: App.models.app
	});

	this.listView = new Backbone.CollectionView({
		el: this.$el,
		modelView: App.Views.Image,
		collection: App.collections.images
	});

	this.paginationView = new App.Views.Pagination({
		el: $('#images_pagination'),
		model: App.models.app
	});

	return this;
}

App.Views.Images.prototype.render = function () {
	this.infoView.render();
	this.listView.render();
	this.paginationView.render();
}

App.Views.Images.prototype.animationStart = function () {
	this.$el.parent().addClass('anim-active');
}

App.Views.Images.prototype.animationEnd = function () {
	this.$el.parent().removeClass('anim-active');
}

App.Views.Images.prototype.renderPage = function (id) {
	App.views.images.animationStart();
	App.collections.images.getPage(id).done(function (resp) {
		App.collections.images.update(null, resp, null);
	});
}
App.Views.Index = Backbone.View.extend({
	template: _.template($('#tpl-index').html()),
	el: $('#container'),
	initialize: function () {
		this.render();
		this.listenTo(App.models.upload, 'change', this.renderUpload())
		this.listenTo(App.collections.images, 'add remove', this.renderList())
	},
	events: {
		'click [data-action="toggle-upload"]': 'handleUploadVisibility'
	},
	render: function () {
		this.$el.html(this.template(this.model.toJSON()));
		App.views.images = new App.Views.Images();
	},
	renderList: function () {
		App.views.images.render();
		$.material.init();
	},
	renderUpload: function () {
		new App.Views.Upload({
			el: this.$el.find('#upload'),
			model: App.models.upload
		});
	},
	render404: function () {
		this.$el.find('.error-404').show();
	},
	handleUploadVisibility: function () {
		this.$el.find('.upload').toggle();
	},
	
});
App.Views.Info = Backbone.View.extend({
	template: _.template($('#tpl-panel').html()),
	initialize: function () {
		this.listenTo(this.model, 'change', this.render);
	},
	render: function () {
		this.$el.html(this.template(this.model.attributes));
		this.$el.show();
	},
});
App.Views.Message = Backbone.View.extend({
	template: _.template($('#tpl-message').html()),
	initialize: function () {
		this.render();
	},
	render: function () {
		this.$el.html(this.template(this.model.toJSON()));
	},
});
App.Views.Pagination = Backbone.View.extend({
	template: _.template($('#tpl-pagination').html()),
	initialize: function () {
		this.listenTo(this.model, 'change', this.render);
	},
	events: {
		'click a': 'handlePage'
	},
	handlePage: function (e) {
		var $li = $(e.target).parent();
		if ($li.hasClass('disabled')) return;

		var pageID = +$(e.target).data('page');
		if (pageID === App.models.app.get('pagination').currentPage) return;

		App.routers.index.navigate('page/' + pageID, {trigger: true});
	},
	render: function () {
		var model = this.model.toJSON().pagination;
		var pages = _.range(1, model.pages + 1);
		if (model.pages === 1) return;
		if (model.currentPage > model.pages) return;

		model.pagesCount = model.pages;

		if (model.pages > model.pagesLimit) {
			pages = _.range(1, model.pages + 1);
			if (model.currentPage <= model.pagesLimit / 2) {
				pages = pages.slice(0, model.pagesLimit - 2);
			}
			else if (model.pages - model.currentPage <= model.pagesLimit / 2) {
				pages = pages.slice(-model.pagesLimit + 2);
			}
			else {

				pages = pages.slice(model.currentPage - model.pagesLimit / 2, model.pagesLimit - 2);
			}

		}


		model.pages = pages;

		this.$el.html(this.template(model));
		this.delegateEvents();
	},
});
App.Views.Upload = Backbone.View.extend({
	template: _.template($('#tpl-upload').html()),
	initialize: function () {
		this.messages = new App.Collections.Base();
		this.listenTo(this.messages, 'update', this.handleErrors);

		this.render();
	},
	bindings: {
		'[name="storage"]': 'storage',
		'[name="url"]': 'url',

		// swicth input visibility depends on source type
		'.source-file': {
			observe: 'source_type',
			visible: function (val, options) {
				return val === 'file';
			},
		},
		// swicth input visibility depends on source type
		'.source-url': {
			observe: 'source_type',
			visible: function (val, options) {
				return val === 'url';
			}
		}
	},
	events: {
		// handle source type switcher
		'click .btn-group span': 'handleGroup',
		'submit form': 'handleSubmit'
	},
	handleGroup: function (e) {
		e.preventDefault();

		var $el = $(e.target);
		var $container = $($el.parent());
		var field = $container.data('field');
		var val = $el.data('content');

		this.model.set(field, val);
		this.model.set('url', '');
		$container.find('span').removeClass('btn-raised active');
		$el.addClass('btn-raised active')
	},
	handleSubmit: function (e) {
		e.preventDefault();
		this.messages.reset();

		var _this = this;
		var model = this.model.toJSON();
		var data = new FormData(this);
		var files = this.$el.find('[name="file"]').prop('files');

		data.append('method', 'PUT');
		data.append('storage', model.storage);
		data.append('source_type', model.source_type);
		data.append('url', model.url);

		if (model.source_type === 'file' && _.isEmpty(files)) {
			var msg = new App.Models.Message({
				message: 'Please choose image before submit'
			})
			this.messages.set(msg);
		}

		if (model.source_type === 'url' && model.url === '') {
			var msg = new App.Models.Message({
				message: 'Please input image URL before submit'
			})
			this.messages.set(msg);
		}

		/*if (App.collections.images.findWhere({hash: md5(file.name + model.storage)})){
			var msg = new App.Models.Message({
				type: 'warning',
				message: 'File already exist'
			})
			this.messages.set(msg);
		};*/

		if (model.source_type === 'file') {
			_.each(files, function (file) {
				data.append('files[]', file);
			});
		}

		if (this.messages.toJSON().length > 0) return;

		App.views.images.animationStart();

		$.ajax({
			url: '/public/image.php',
			dataType: 'text',
			type: 'POST',
			contentType: false,
			cache: false,
			processData: false,
			data: data,
			success: function (code) {
				if(code == 400){
					var msg = new App.Models.Message({
						type: 'danger',
						message: 'Wrong file format. Only PNG, GIF and JPG are allowed.'
					});
					_this.messages.set(msg);
				}
				if(code == 401){
					var msg = new App.Models.Message({
						type: 'danger',
						message: 'Wrong URL format. '
					});
					_this.messages.set(msg);
				}
				if(code == 500){
					var msg = new App.Models.Message({
						type: 'danger',
						message: 'Something went wrong. Please call 911'
					});
					_this.messages.set(msg);
				}

				// reset form fields with dirty hacks
				_this.model.set('url', '');
				_this.$el.find('.file-overlay').val('');
				_this.$el.find('[name="file"]').replaceWith(_this.$el.find('[name="file"]').val('').clone(true));

				App.collections.images.fetch({
					success: App.collections.images.update
				});
			}
		});
	},
	handleErrors: function () {
		if (this.messages.toJSON().length === 0) return;

		var messagesView = new Backbone.CollectionView({
			el: this.$el.find("#upload_messages"), // must be UL or TABLE element
			modelView: App.Views.Message,
			collection: this.messages,
			selectable: false,
		});
		messagesView.render();
	},
	render: function () {
		this.$el.html(this.template(this.model.toJSON()));

		this.stickit();
	},
});